import React from 'react';
import './VideoCard.css';
//import paris from '../image';

function VideoCard() {
    // const videoRef = use



    return (
        <div className='videoCard'>
            <video className="videoCard__player"
            src='https://scontent-ssn1-1.cdninstagram.com/v/t50.2886-16/117932784_329931645035937_7460453733854060462_n.mp4?_nc_ht=scontent-ssn1-1.cdninstagram.com&_nc_cat=109&_nc_ohc=Tn6WhLZ7rgMAX_vE_el&oe=5F88B53A&oh=bbc6d5ecf8da54937f31c2a20a668384'
            // src='https://www.instagram.com/p/CEHhjBwCo9M/?utm_source=ig_web_button_share_sheet'

            // src='https://www.instagram.com/s/aGlnaGxpZ2h0OjE3OTM5ODk3MzA1Mzk1MzM4?igshid=rmm80fyryz0r'
            alt='TG reel video'
            loop={true}
            />
            <img className="picture__player" src="/image/paris.jpg" />
        </div>
    )
}

export default VideoCard
